        // Initialize Select2 for searchable dropdown
        $(document).ready(function() {
            $('.searchable-dropdown').select2();
        });

        // Function to populate a select element with options
        function populateSelect(selectId, options) {
            const select = document.getElementById(selectId);
            select.innerHTML = '<option value="">Select</option>';
            options.forEach(option => {
                const opt = document.createElement('option');
                opt.value = option;
                opt.textContent = option;
                select.appendChild(opt);
            });
            if(selectId === 'resource-description') {
                $('#resource-description').select2(); // Reinitialize Select2
            }
        }

        // Function to update the makes based on the selected fleet type
        function updateMakes() {
            const fleetTypeSelect = document.getElementById('fleet-type');
            const selectedFleetType = fleetTypeSelect.value;
            const makes = [...new Set(sparePartsData.filter(item => item["Fleet Type"] === selectedFleetType).map(item => item.Make))];
            populateSelect('make', makes);
            document.getElementById('model').innerHTML = '<option value="">Select Model</option>';
            document.getElementById('capacity').innerHTML = '<option value="">Select Capacity</option>';
            document.getElementById('resource-description').innerHTML = '<option value="">Select Resource Description</option>';
        }

        // Function to update the models based on the selected make
        function updateModels() {
            const fleetTypeSelect = document.getElementById('fleet-type');
            const makeSelect = document.getElementById('make');
            const selectedFleetType = fleetTypeSelect.value;
            const selectedMake = makeSelect.value;
            const models = [...new Set(sparePartsData.filter(item => item["Fleet Type"] === selectedFleetType && item.Make === selectedMake).map(item => item.Model))];
            populateSelect('model', models);
            document.getElementById('capacity').innerHTML = '<option value="">Select Capacity</option>';
            document.getElementById('resource-description').innerHTML = '<option value="">Select Resource Description</option>';
        }

        // Function to update the capacities based on the selected model
        function updateCapacities() {
            const fleetTypeSelect = document.getElementById('fleet-type');
            const makeSelect = document.getElementById('make');
            const modelSelect = document.getElementById('model');
            const selectedFleetType = fleetTypeSelect.value;
            const selectedMake = makeSelect.value;
            const selectedModel = modelSelect.value;
            const capacities = [...new Set(sparePartsData.filter(item => item["Fleet Type"] === selectedFleetType && item.Make === selectedMake && item.Model === selectedModel).map(item => item.Capacity))];
            populateSelect('capacity', capacities);
            document.getElementById('resource-description').innerHTML = '<option value="">Select Resource Description</option>';
        }

        // Function to update the resource descriptions based on the selected capacity
        function updateResourceDescriptions() {
            const fleetTypeSelect = document.getElementById('fleet-type');
            const makeSelect = document.getElementById('make');
            const modelSelect = document.getElementById('model');
            const capacitySelect = document.getElementById('capacity');
            const selectedFleetType = fleetTypeSelect.value;
            const selectedMake = makeSelect.value;
            const selectedModel = modelSelect.value;
            const selectedCapacity = capacitySelect.value;
            const resourceDescriptions = [...new Set(sparePartsData.filter(item => item["Fleet Type"] === selectedFleetType && item.Make === selectedMake && item.Model === selectedModel && item.Capacity === selectedCapacity).map(item => item["Resource Description"]))];
            populateSelect('resource-description', resourceDescriptions);
        }

        // Function to find and display spare parts based on the selected criteria
        function findSpareParts() {
            const fleetTypeSelect = document.getElementById('fleet-type');
            const makeSelect = document.getElementById('make');
            const modelSelect = document.getElementById('model');
            const capacitySelect = document.getElementById('capacity');
            const resourceDescriptionSelect = document.getElementById('resource-description');
            const sparePartsList = document.getElementById('spare-parts-list');

            const selectedFleetType = fleetTypeSelect.value;
            const selectedMake = makeSelect.value;
            const selectedModel = modelSelect.value;
            const selectedCapacity = capacitySelect.value;
            const selectedResourceDescription = resourceDescriptionSelect.value;

            sparePartsList.innerHTML = '';

            if (selectedFleetType && selectedMake && selectedModel && selectedCapacity && selectedResourceDescription) {
                const spareParts = sparePartsData.filter(item => 
                    item["Fleet Type"] === selectedFleetType && 
                    item.Make === selectedMake && 
                    item.Model === selectedModel && 
                    item.Capacity === selectedCapacity &&
                    item["Resource Description"] === selectedResourceDescription
                );
                spareParts.forEach(part => {
                    const li = document.createElement('li');
                    li.innerHTML = `
                        <strong>Resource Code:</strong> ${part.ResourceCode}<br>
                        <strong>Description:</strong> ${part["Resource Description"]}<br>
                        <strong>Part No:</strong> ${part["Part No"]}<br>
                        <strong>Engine Desc:</strong> ${part["Engine Desc"]}
                    `;
                    sparePartsList.appendChild(li);
                });
            } else {
                const li = document.createElement('li');
                li.textContent = 'Please select all fields.';
                sparePartsList.appendChild(li);
            }
        }

        // Initialize fleet type options on page load
        document.addEventListener('DOMContentLoaded', () => {
            const fleetTypes = [...new Set(sparePartsData.map(item => item["Fleet Type"]))];
            populateSelect('fleet-type', fleetTypes);
            $('#resource-description').select2();
        });
    </script>
